window.bookSummaryJSON = "<p><b><i>Always Alchemy</i></b><b> is a full-length happy ever after for all of your favorite Alchemy characters, complete with all the spice, emotion, heartwarming moments, and hilarity that you've come to expect from the series.</b></p> <p>Do you absolutely need to see Max, Dex, and Darcy exchange vows? Want a front-row seat to the sexy chaos that ensues when Cal decides to raise money for the rainforests? Desperate for that spreader bar scene between Adam and Nat? Have you long harbored a suspicion that Anton's Terrible Twins will cause even more havoc as they get older?</p> <p>You're in the right place!</p> <p>Always Alchemy <i>takes place over the course of a decade. Grab a drink, find a comfy seat, and enjoy this glimpse into the futures of the beloved Alchemy gang.</i></p> <p>Always Alchemy <i>is intended for listeners who have already listened to the Alchemy series. If you're new to the series, give </i>Unfurl <i>a whirl instead!</i></p>"; 
